.exhibition-detail-page {
  width: 100%;
  background-image: url("https://res.cloudinary.com/dn0br7hj0/image/upload/background/Background2.webp");
  background-repeat: repeat;
  background-position: top center;
  background-size: 300px;
  image-rendering: -webkit-optimize-contrast;
  image-rendering: crisp-edges;
}

.exhibition-detail-page-back-button {
  position: absolute;
  top: 100px;
  left: 20px;
  display: flex;
  align-items: center;
  gap: 8px;
  padding: 10px 20px;
  color: #fff;
  font-family: "Roboto", sans-serif;
  font-size: 1rem;
  text-decoration: none;
  transition: all 0.3s ease;
  z-index: 100;
}

.exhibition-detail-page-back-button:hover {
  background-color: #2c2f11;
  color: #fff;
  transform: translateY(-2px);
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
}

.exhibition-detail-page-back-button svg {
  font-size: 1.2rem;
}

/* Hero Section */
.exhibition-detail-page-hero {
  position: relative;
  width: 100%;
  height: 100vh;
  overflow: hidden;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding-top: 35px;
}

.exhibition-detail-page-hero-background {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background-size: cover;
  background-position: center;
  filter: blur(2.5px);
}

.exhibition-detail-page-hero-overlay {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background-color: rgba(44, 47, 17, 0.7);
}

.exhibition-detail-page-hero-content {
  position: relative;
  z-index: 1;
  text-align: center;
  color: #fff;
  width: 100%;
  margin-top: 60px;
}

.exhibition-detail-page-hero-title {
  font-family: "Mythical-Prince", "LouvreSerif", Georgia, "Times New Roman",
    serif;
  font-size: 3rem;
}

.exhibition-detail-page-hero-date {
  font-family: "Roboto", sans-serif;
  font-size: 1.2rem;
  margin-bottom: 40px;
}

.exhibition-detail-page-hero-image {
  width: 60%;
  height: 60%;
  object-fit: contain;
}

/* Exhibition Detail Product Section */
.exhibition-detail-page-product {
  margin: 0px auto;
  padding: 0 20px;
}

.exhibition-detail-page-section-title {
  font-family: "Meholrax", serif;
  font-size: 2rem;
  color: #2c2f11;
  margin-top: 30px;
  margin-bottom: 0px;
}

.exhibition-detail-page-item {
  text-decoration: none;
  display: block;
}

.exhibition-detail-page-product-image {
  width: 100%;
  aspect-ratio: 1;
  overflow: hidden;
}

.exhibition-detail-page-product-image img {
  width: 100%;
  height: 100%;
  object-fit: cover;
}

.exhibition-detail-page-product-title {
  font-family: "Roboto", sans-serif;
  font-size: 1.5rem;
  color: #2c2f11;
  margin-bottom: 3px;
  text-align: center;
}

.exhibition-detail-page-product-price {
  font-family: "Roboto", sans-serif;
  font-size: 1.3rem;
  color: #666;
  text-align: center;
  margin-bottom: 40px;
}

/* Exhibition Detail Info Section */
.exhibition-detail-page-info {
  background-color: #2c2f11;
  color: white;
  padding: 60px 20px;
  margin: 40px 0;
}

.exhibition-detail-page-info-container {
  max-width: 1200px;
  margin: 0 auto;
  display: grid;
  grid-template-columns: 1fr 2fr;
  gap: 40px;
  align-items: start;
}

.exhibition-detail-page-info-image {
  position: relative;
  width: 100%;
  padding-top: 120%;
  border-radius: 12px;
  overflow: hidden;
  box-shadow: 0 10px 30px rgba(0, 0, 0, 0.3);
  transition: transform 0.3s ease, box-shadow 0.3s ease;
}

.exhibition-detail-page-info-image:hover {
  transform: translateY(-5px);
  box-shadow: 0 15px 40px rgba(0, 0, 0, 0.4);
}

.exhibition-detail-page-info-image img {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  object-fit: cover;
  transition: transform 0.3s ease;
}

.exhibition-detail-page-info-image:hover img {
  transform: scale(1.05);
}

.exhibition-detail-page-info-content {
  padding: 30px;
  background: rgba(255, 255, 255, 0.05);
  border-radius: 12px;
  backdrop-filter: blur(10px);
}

.exhibition-detail-page-info-title {
  font-family: "Mythical-Prince", "LouvreSerif", Georgia, "Times New Roman",
    serif;
  font-size: 3rem;
  margin-bottom: 30px;
  color: yellowgreen;
  text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.3);
}

.exhibition-detail-page-info-description {
  font-family: "Roboto", sans-serif;
  line-height: 1.8;
  margin-bottom: 25px;
  color: rgba(255, 255, 255, 0.9);
  font-size: 1.1rem;
}

.exhibition-detail-page-stats {
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 25px;
  margin-top: 40px;
}

.exhibition-detail-page-stat-item {
  text-align: center;
  padding: 25px;
  background-color: rgba(255, 255, 255, 0.1);
  border-radius: 12px;
  transition: transform 0.3s ease, background-color 0.3s ease;
}

.exhibition-detail-page-stat-item:hover {
  transform: translateY(-5px);
  background-color: rgba(255, 255, 255, 0.15);
}

.exhibition-detail-page-stat-item h3 {
  font-size: 1.5rem;
  color: yellowgreen;
  margin-bottom: 15px;
  font-weight: 700;
}

.exhibition-detail-page-stat-item p {
  font-size: 1rem;
  margin: 0;
  color: rgba(255, 255, 255, 0.8);
  text-transform: uppercase;
  letter-spacing: 1px;
}

/* Exhibition Detail All Products Section */
.exhibition-detail-page-all-products {
  padding: 40px 20px;
}

.exhibition-detail-page-all-products-title {
  font-family: "Mythical-Prince", "LouvreSerif", Georgia, "Times New Roman",
    serif;
  text-align: center;
  color: #2c2f11;
  margin-bottom: 40px;
  font-size: 2.5rem;
}

.exhibition-detail-page-products-grid {
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: 20px;
  max-width: 1200px;
  margin: 0 auto;
}

.exhibition-detail-page-product-card {
  position: relative;
  overflow: hidden;
  transition: transform 0.3s ease;
  text-decoration: none;
}

.exhibition-detail-page-product-card:hover {
  transform: translateY(-5px);
}

.exhibition-detail-page-product-card img {
  width: 100%;
  height: 300px;
  object-fit: cover;
}

.exhibition-detail-page-product-content {
  padding: 15px;
  text-align: center;
}

.exhibition-detail-page-product-content h3 {
  font-family: "Roboto", sans-serif;
  font-size: 1.1rem;
  margin-bottom: 8px;
  color: #2c2f11;
}

.exhibition-detail-page-product-content p {
  font-size: 0.9rem;
  color: #000;
}

/* Sort Section */
.exhibition-detail-page-sort {
  display: flex;
  justify-content: flex-start;
  align-items: center;
  margin-bottom: 30px;
  font-family: "Roboto", sans-serif;
  padding: 0px 20px;
}

.exhibition-detail-page-total-products {
  font-size: 0.9rem;
  color: #666;
  display: flex;
  align-items: center;
  gap: 4px;
}

.exhibition-detail-page-total-count {
  font-weight: 500;
  color: #2c2f11;
}

.exhibition-detail-page-sort-dropdown {
  position: relative;
  margin-left: auto;
}

.exhibition-detail-page-sort-header {
  display: flex;
  align-items: center;
  cursor: pointer;
  padding: 8px 12px;
  font-size: 0.85rem;
  color: #666;
  user-select: none;
}

.exhibition-detail-page-sort-header.active {
  color: #2c2f11;
}

.exhibition-detail-page-sort-header svg {
  font-size: 24px;
  color: #2c2f11;
  transition: transform 0.3s ease;
}

.exhibition-detail-page-sort-header svg.rotated {
  transform: rotate(180deg);
}

.exhibition-detail-page-sort-menu {
  position: absolute;
  top: calc(100% + 4px);
  right: 0;
  background-color: white;
  border-radius: 4px;
  box-shadow: 0 2px 8px rgba(0, 0, 0, 0.15);
  min-width: 200px;
  z-index: 100;
}

.exhibition-detail-page-sort-option {
  padding: 10px 16px;
  cursor: pointer;
  font-size: 0.9rem;
  color: #666;
  transition: all 0.2s ease;
}

.exhibition-detail-page-sort-option:hover {
  background-color: #f5f5f5;
  color: #2c2f11;
}

.exhibition-detail-page-sort-option.active {
  background-color: #f5f5f5;
  color: #2c2f11;
  font-weight: 500;
}

/* Pagination */
.exhibition-detail-page-pager {
  display: flex;
  justify-content: center;
  align-items: center;
  gap: 10px;
  margin: 40px 0;
}

.exhibition-detail-page-pager button {
  width: 40px;
  height: 40px;
  border: 1px solid #ddd;
  background: #2c2f11;
  border-radius: 4px;
  color: #fff;
  display: flex;
  align-items: center;
  justify-content: center;
  cursor: pointer;
  transition: all 0.3s ease;
}

.exhibition-detail-page-pager button.active {
  background-color: #2c2f11;
  color: yellowgreen;
  border-color: #fff;
}

.exhibition-detail-page-pager button:hover:not(:disabled) {
  background-color: #2c2f11;
  color: white;
}

.exhibition-detail-page-pager button:disabled {
  opacity: 0.5;
  cursor: not-allowed;
}

/* Filter Button */
.exhibition-detail-page-filter-button {
  position: fixed;
  bottom: 20px;
  left: 50%;
  transform: translateX(-50%);
  background-color: #2c2f11;
  color: white;
  border: none;
  padding: 12px 30px;
  border-radius: 30px;
  font-family: "Roboto", sans-serif;
  font-size: 1rem;
  cursor: pointer;
  z-index: 1000;
  box-shadow: 0 4px 15px rgba(0, 0, 0, 0.2);
  transition: transform 0.3s ease, box-shadow 0.3s ease;
}

.exhibition-detail-page-filter-button:hover {
  transform: translateX(-50%) translateY(-2px);
  box-shadow: 0 6px 20px rgba(0, 0, 0, 0.3);
}

/* Swiper customization */
.exhibition-detail-page .swiper-button-next,
.exhibition-detail-page .swiper-button-prev {
  color: #2c2f11;
}

.exhibition-detail-page .swiper-pagination {
  position: relative;
  margin-top: 20px;
}

.exhibition-detail-page .swiper-pagination-bullet {
  width: 40px !important;
  height: 4px !important;
  border-radius: 0 !important;
  margin: 0 5px !important;
  background: rgba(44, 47, 17, 0.2) !important;
  opacity: 1;
}

.exhibition-detail-page .swiper-pagination-bullet-active {
  background: #2c2f11 !important;
}

/* Responsive Design */
@media (min-width: 1024px) {
  .exhibition-detail-page-products-grid {
    grid-template-columns: repeat(4, 1fr);
  }
}

@media (max-width: 1024px) {
  .exhibition-detail-page-info-container {
    grid-template-columns: 1fr;
    gap: 30px;
  }

  .exhibition-detail-page-info-image {
    padding-top: 80%;
    max-width: 600px;
    margin: 0 auto;
  }

  .exhibition-detail-page-info-title {
    font-size: 2.5rem;
    text-align: center;
  }

  .exhibition-detail-page-stats {
    grid-template-columns: repeat(3, 1fr);
    gap: 20px;
  }
}

@media (max-width: 768px) {
  .exhibition-detail-page-back-button {
    padding: 8px 16px;
    font-size: 0.9rem;
  }

  .exhibition-detail-page-hero-title {
    font-size: 2.5rem;
  }

  .exhibition-detail-page-hero-date {
    font-size: 1rem;
  }

  .exhibition-detail-page-hero-image {
    width: 80%;
  }

  .exhibition-detail-page-info {
    padding: 40px 20px;
  }

  .exhibition-detail-page-info-content {
    padding: 20px;
  }

  .exhibition-detail-page-info-title {
    font-size: 2rem;
  }

  .exhibition-detail-page-info-description {
    font-size: 1rem;
  }

  .exhibition-detail-page-stat-item {
    padding: 20px;
  }

  .exhibition-detail-page-stat-item h3 {
    font-size: 1.3rem;
  }

  .exhibition-detail-page-stat-item p {
    font-size: 0.9rem;
  }

  .exhibition-detail-page-sort {
    flex-direction: column;
    align-items: flex-start;
    gap: 10px;
  }

  .exhibition-detail-page-all-products-title {
    font-size: 2rem;
  }

  .exhibition-detail-page-pager button {
    width: 35px;
    height: 35px;
  }

  .exhibition-detail-page .swiper-pagination-bullet {
    width: 30px !important;
    height: 3px !important;
  }
}

@media (max-width: 480px) {
  .exhibition-detail-page-hero-title {
    font-size: 2rem;
  }

  .exhibition-detail-page-hero-image {
    width: 90%;
  }

  .exhibition-detail-page-stats {
    grid-template-columns: 1fr;
    gap: 15px;
  }

  .exhibition-detail-page-stat-item {
    padding: 15px;
  }

  .exhibition-detail-page-products-grid {
    grid-template-columns: 1fr;
  }
}

/* Filter Modal */
.exhibition-detail-page-filters-modal {
  position: fixed;
  bottom: 0;
  left: 0;
  width: 100%;
  height: 90vh;
  background-color: #2c2f11;
  color: white;
  z-index: 1000;
  border-radius: 20px 20px 0 0;
  box-shadow: 0 -4px 20px rgba(0, 0, 0, 0.1);
  overflow-y: auto;
  transition: transform 0.3s ease;
}

.exhibition-detail-page-filters-content {
  padding: 20px;
}

.exhibition-detail-page-filters-header {
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 30px;
  padding: 0 10px;
}

.exhibition-detail-page-filters-title {
  font-size: 1.5rem;
  font-weight: 500;
  color: white;
  margin: 0;
}

.exhibition-detail-page-close-filters {
  background: none;
  border: none;
  padding: 8px;
  cursor: pointer;
  color: #666;
  font-size: 1.5rem;
  display: flex;
  align-items: center;
  justify-content: center;
  transition: color 0.3s ease;
}

.exhibition-detail-page-close-filters:hover {
  color: #2c2f11;
}

.exhibition-detail-page-filter-section {
  margin-bottom: 20px;
  border-bottom: 1px solid #eee;
  padding-bottom: 20px;
}

.exhibition-detail-page-filter-header {
  display: flex;
  justify-content: space-between;
  align-items: center;
  cursor: pointer;
  padding: 10px;
  transition: background-color 0.3s ease;
}

.exhibition-detail-page-filter-header h3 {
  margin: 0;
  font-size: 1.1rem;
  color: white;
}

.exhibition-detail-page-filter-header svg {
  font-size: 24px;
  color: white;
  transition: transform 0.3s ease;
}

.exhibition-detail-page-filter-header svg.rotated {
  transform: rotate(180deg);
}

.exhibition-detail-page-price-range {
  padding: 20px 10px;
}

.exhibition-detail-page-price-inputs {
  position: relative;
  height: 40px;
  margin-bottom: 20px;
}

.exhibition-detail-page-price-inputs input[type="range"] {
  position: absolute;
  width: 100%;
  pointer-events: none;
  appearance: none;
  height: 2px;
  background: #ddd;
  outline: none;
}

.exhibition-detail-page-price-inputs input[type="range"]::-webkit-slider-thumb {
  pointer-events: auto;
  appearance: none;
  width: 16px;
  height: 16px;
  background: white;
  border-radius: 50%;
  cursor: pointer;
}

.exhibition-detail-page-price-values {
  display: flex;
  justify-content: space-between;
  font-size: 0.9rem;
  color: white;
}

.exhibition-detail-page-filter-options {
  padding: 10px;
  color: white;
}

.exhibition-detail-page-filter-option {
  display: flex;
  align-items: center;
  gap: 10px;
  padding: 8px 0;
  cursor: pointer;
  color: white;
}

.exhibition-detail-page-filter-option input[type="checkbox"] {
  width: 18px;
  height: 18px;
  border: 2px solid #2c2f11;
  border-radius: 4px;
  cursor: pointer;
}

.exhibition-detail-page-filter-option span {
  font-size: 0.9rem;
  color: white;
}

.exhibition-detail-page-filter-option .count {
  color: white;
  margin-left: auto;
}

.exhibition-detail-page-apply-filters {
  position: sticky;
  bottom: 0;
  width: 100%;
  padding: 15px;
  background-color: #2c2f11;
  color: white;
  border: none;
  font-size: 1rem;
  cursor: pointer;
  transition: background-color 0.3s ease;
}

.exhibition-detail-page-apply-filters:hover {
  background-color: #3a3e17;
}

.exhibition-detail-page-apply-filters:disabled {
  background-color: #ccc;
  cursor: not-allowed;
}

/* Responsive styles */
@media (max-width: 768px) {
  .exhibition-detail-page-filters-modal {
    height: 100vh;
    border-radius: 0;
  }

  .exhibition-detail-page-filters-title {
    font-size: 1.3rem;
  }

  .exhibition-detail-page-filter-header h3 {
    font-size: 1rem;
  }
}

@media (max-width: 480px) {
  .exhibition-detail-page-filters-content {
    padding: 15px;
  }

  .exhibition-detail-page-price-values {
    font-size: 0.8rem;
  }

  .exhibition-detail-page-filter-option span {
    font-size: 0.8rem;
  }
}

.exhibition-detail-page-search-section {
  margin-bottom: 20px;
  padding: 0 10px;
}

.exhibition-detail-page-search-input {
  width: 100%;
  padding: 12px;
  border: 1px solid rgba(255, 255, 255, 0.2);
  border-radius: 8px;
  background-color: rgba(255, 255, 255, 0.1);
  color: white;
  font-size: 1rem;
  outline: none;
  transition: all 0.3s ease;
}

.exhibition-detail-page-search-input::placeholder {
  color: rgba(255, 255, 255, 0.6);
}

.exhibition-detail-page-search-input:focus {
  border-color: rgba(255, 255, 255, 0.4);
  background-color: rgba(255, 255, 255, 0.15);
}

.exhibition-detail-page-filter-option {
  display: flex;
  align-items: center;
  gap: 12px;
  padding: 12px;
  border-radius: 8px;
  transition: background-color 0.3s ease;
  margin-bottom: 8px;
  background-color: rgba(255, 255, 255, 0.1);
}

.exhibition-detail-page-filter-option:hover {
  background-color: rgba(255, 255, 255, 0.15);
}

.exhibition-detail-page-filter-option input[type="checkbox"] {
  width: 20px;
  height: 20px;
  border: 2px solid rgba(255, 255, 255, 0.4);
  border-radius: 4px;
  cursor: pointer;
  appearance: none;
  background-color: transparent;
  position: relative;
  transition: all 0.3s ease;
}

.exhibition-detail-page-filter-option input[type="checkbox"]:checked {
  background-color: white;
  border-color: white;
}

.exhibition-detail-page-filter-option input[type="checkbox"]:checked::after {
  content: "âœ“";
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  color: #2c2f11;
  font-size: 14px;
}

.exhibition-detail-page-filter-option span {
  flex: 1;
  font-size: 0.95rem;
}

.exhibition-detail-page-filter-option .price {
  font-weight: 500;
  color: rgba(255, 255, 255, 0.9);
}

.exhibition-detail-page-filter-options {
  max-height: 300px;
  overflow-y: auto;
  padding: 10px;
  scrollbar-width: thin;
  scrollbar-color: rgba(255, 255, 255, 0.3) transparent;
}

.exhibition-detail-page-filter-options::-webkit-scrollbar {
  width: 6px;
}

.exhibition-detail-page-filter-options::-webkit-scrollbar-track {
  background: transparent;
}

.exhibition-detail-page-filter-options::-webkit-scrollbar-thumb {
  background-color: rgba(255, 255, 255, 0.3);
  border-radius: 3px;
}

@media (max-width: 768px) {
  .exhibition-detail-page-search-input {
    padding: 10px;
    font-size: 0.9rem;
  }

  .exhibition-detail-page-filter-option {
    padding: 10px;
  }

  .exhibition-detail-page-filter-option span {
    font-size: 0.9rem;
  }
}

@media (max-width: 480px) {
  .exhibition-detail-page-search-input {
    padding: 8px;
    font-size: 0.85rem;
  }

  .exhibition-detail-page-filter-option {
    padding: 8px;
  }

  .exhibition-detail-page-filter-options {
    max-height: 250px;
  }
}
